import React, {Component} from "react";
import "./App.css";
import Person from "./Person/Person";

class App extends Component {

  state = {
    persons:[
      {name: "Max", age:29},
      {name: "Manue", age: 20},
      {name: "Alex", age: 18}
    ]
  };

  render(){
    return (
      <div className="App">
        <h1>Lets Managing Some Lists At the bottom!</h1>
        <Person name="Max" age="20" />
        <Person name="Manue" age="29">
          Hobbies: Racing
        </Person>
        <Person name="Bob" age="18" />
      </div>
    );
  }

}

export default App;
